CREATE DEFINER=`root`@`localhost` FUNCTION `ObtenerGastoEnergicoBasal`(pesoKg float,alturaCms float, edadAnios int,sexo varchar(45)) RETURNS float
BEGIN
	DECLARE geb FLOAT;
	IF sexo = 'FEMENINO' THEN SET @geb = 66.5 + (13.7 * pesoKg) + (5 * alturaCms) - (6.8 * edadAnios);
    ELSEIF sexo = 'MASCULINO' THEN SET @geb = 655 + (9.7 * pesoKg) + (1.8 * alturaCms) - (4.7 * edadAnios);
    ELSE SET @geb = 0.00;
	end if;
RETURN @geb;
END ;;
DELIMITER ;
